import React from 'react'
import { Box, Dialog, DialogActions, DialogContent,  DialogContentText, DialogTitle } from '@material-ui/core'
import { withStyles } from '@material-ui/core/styles'
import PropTypes from 'prop-types'

const styles = (theme) => ({
    root : {
        width : "100vw",
        height : "100vh",
        backgroundColor : "rgba(0,0,0,0.3)",
        display : "flex",
        justifyContent : "center",
        alignItems : "center",
        position : "absolute",

    },
    map : {
        backgroundImage : 'url(/static/images/map.png)',
        width : "100%",
        height : "100%" 
    }
})

const Location = ({ classes, handleClose, open }) => {
    return <Box className={classes.root}>
        <Dialog
        open={open}
        onClose={handleClose}
        aria-labelledby="alert-dialog-title"
        aria-describedby="alert-dialog-description"
        fullWidth={true}
        maxWidth={"lg"}
      >
        <DialogTitle id="alert-dialog-title">{"Use Google's location service?"}</DialogTitle>
        <div style={{ width : "100%",height : "100%" ,backgroundColor }}></div>
      </Dialog>
    </Box>
}

Location.propTypes = {
    open : PropTypes.bool,
    handleClose : PropTypes.func,
    // eslint-disable-next-line react/forb,id-prop-types
    classes: PropTypes.object.isRequired,
}

export default withStyles(styles)(Location)
